May 17, 2011

Lux is a lesbian who broke up with her girlfriend a few weeks ago and hasn't gotten laid since. Expressing concern, Lux's friend drags her to a women-only bathhouse in the hopes of helping her get some much needed action. Reluctant at first, Lux soon warms up to the idea when Eden gives her the eye.
